import React from "react";
import Beyonce, { Beyonce_Bottom, Beyonce_Top } from "./contacts"

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <div className="top">
          <Beyonce_Top/>
        </div>
        <div className="bottom">
          <Beyonce_Bottom/>
        </div>
      </div>
    </div>
  );
}

export default App;
